using System;\nusing System.Collections.Generic;\nusing System.Linq;\n\nclass Program\n{\n    static void Main()\n    {\n        List<string> listOfStrings = new List<string> { "apple", "banana", "apple", "orange", "banana" };\n        \n        // Using LINQ to get distinct/unique values\n        IEnumerable<string> uniqueStrings = listOfStrings.Distinct();\n\n        foreach (string str in uniqueStrings)\n        {\n            Console.WriteLine(str);\n        }\n    }\n}